import "./App.css";
import Header from "./components/Header";
import Body from "./components/Body";
import Footer from "./components/Footer";
import React, { useEffect, useState } from "react";

function App() {
  return (
    <>
      <div className="test">
        <Header className="header" />
        <Body className="body" />
        <Footer className="footer" />
      </div>
    </>
  );
}

export default App;
